import Nav from "./Nav";
import "./header.css";

export default function Header({ dateMonth }) {
	return (
		<header className="mainHeader">
			<div className="divHeader">
				<TitleRefundPage dateMonth={dateMonth} />
				<Nav />
			</div>
		</header>
	);
}
